import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  return (
    <>
      {text.Search.map((t) => {
        {
          console.log(t.Title);
        }
        //        <p>{`O meu filme favorito é o ${t.Title}`}</p>;
      })}
    </>
  );
};

Necas.defaultProps = {
  text: "Sharknado",
};

export default Necas;
